using System;
using Shouldly;
using Xunit;

namespace TechTest.Tests
{
    /// <summary>
    /// Unit tests for StringStatsProcessor.
    /// </summary>
    public class StringStatsProcessorTests
    {
        private readonly StringStatsProcessor _processor;

        public StringStatsProcessorTests()
        {
            _processor = new StringStatsProcessor();
        }

        [Fact]
        public void TestNullValueInput()
        {
            var ex = Should.Throw<ArgumentNullException>(() => _processor.Run(null));
            ex.Message.ShouldStartWith("Value cannot be null.");
        }

        [Fact]
        public void TestHappyPathStringInput()
        {
            var input = "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed vitae massa ornare, fermentum nisl sed, rhoncus magna. Proin eget purus.";
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(133);
            result.NumberOfWords.ShouldBe(20);
            result.LongestWordNumberOfCharacters.ShouldBe(11);
        }

        [Fact]
        public void TestEmptyStringInput()
        {
            var input = string.Empty;
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(0);
            result.NumberOfWords.ShouldBe(0);
            result.LongestWordNumberOfCharacters.ShouldBe(0);
        }

        [Fact]
        public void TestOneSpaceOnlyStringInput()
        {
            var input = " ";
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(0);
            result.NumberOfWords.ShouldBe(0);
            result.LongestWordNumberOfCharacters.ShouldBe(0);
        }

        [Fact]
        public void TestMultipleSpacesOnlyStringInput()
        {
            var input = "     ";
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(0);
            result.NumberOfWords.ShouldBe(0);
            result.LongestWordNumberOfCharacters.ShouldBe(0);
        }

        [Fact]
        public void TestOneWordStringInput()
        {
            var input = "consectetur";
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(11);
            result.NumberOfWords.ShouldBe(1);
            result.LongestWordNumberOfCharacters.ShouldBe(11);
        }

        [Fact]
        public void TestTwoDifferentLengthWordsStringInput()
        {
            var input = "consectetur adipiscing";
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(22);
            result.NumberOfWords.ShouldBe(2);
            result.LongestWordNumberOfCharacters.ShouldBe(11);
        }

        [Fact]
        public void TestTwoSameLengthWordsStringInput()
        {
            var input = "consectetur adipiscings";
            var result = _processor.Run(input);

            result.ShouldBeOfType(typeof(StringStatsModel));
            result.ShouldNotBeNull();
            result.NumberOfCharacters.ShouldBe(23);
            result.NumberOfWords.ShouldBe(2);
            result.LongestWordNumberOfCharacters.ShouldBe(11);
        }

